import React from "react";
import Axios from "axios";
import "./App.css";

function App() {
  // const getCoinData = () => {
  //   Axios.get().then(
  //     (response) => {
  //       console.log(response)
  //     })
  // }

  return (
    <div className="App">
      <p>Hello world, how are you doing today?</p>
      <button>Press me</button>
      <footer>Please press me.</footer>
      <iframe
        src="https://lunarcrush.com/widgets/candlestick?symbol=BTC&interval=1 Week&animation=false&theme=dark"
        id="candlestick"
        frameBorder="0"
        border="0"
        cellspacing="0"
        scrolling="no"
        style="width: 100%; height: 450px;"
      ></iframe>
    </div>
  );
}

export default App;
